

CREATE TABLE `bank` (
  `idb` int(21) NOT NULL AUTO_INCREMENT,
  `bname` varchar(50) NOT NULL,
  `bunivn` int(100) NOT NULL,
  `bcollege` varchar(30) NOT NULL,
  `bbatch` int(4) NOT NULL,
  `bsem` int(4) NOT NULL,
  `bamount` int(11) NOT NULL,
  `bunpaid` int(11) NOT NULL,
  `bdescription` varchar(20) NOT NULL,
  `bTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`idb`)
) ENGINE=MyISAM AUTO_INCREMENT=268 DEFAULT CHARSET=utf8;




CREATE TABLE `exp` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `amount` int(11) NOT NULL,
  `description` varchar(50) NOT NULL,
  `tto` varchar(50) NOT NULL,
  `no` int(11) NOT NULL,
  `cash` int(11) NOT NULL,
  `ffrom` varchar(20) NOT NULL,
  `DATE` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2383 DEFAULT CHARSET=utf8;




CREATE TABLE `f` (
  `batch` int(4) NOT NULL,
  `fees` int(11) NOT NULL,
  `college` varchar(50) COLLATE ucs2_persian_ci NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=ucs2 COLLATE=ucs2_persian_ci;




CREATE TABLE `i` (
  `id` int(21) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `univn` int(100) NOT NULL,
  `college` varchar(30) NOT NULL,
  `batch` int(4) NOT NULL,
  `sem` int(4) NOT NULL,
  `exam` varchar(40) NOT NULL,
  `type` varchar(50) NOT NULL,
  `amount` int(11) NOT NULL,
  `Time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2618 DEFAULT CHARSET=utf8;




CREATE TABLE `p` (
  `id` int(21) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `univn` int(100) NOT NULL,
  `college` varchar(20) NOT NULL,
  `batch` int(4) NOT NULL,
  `sem` int(4) NOT NULL,
  `amount` int(11) NOT NULL,
  `unpaid` int(11) NOT NULL,
  `description` varchar(50) NOT NULL,
  `Time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2744 DEFAULT CHARSET=utf8;




CREATE TABLE `usd` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `univn` int(100) NOT NULL,
  `college` varchar(11) NOT NULL,
  `batch` int(4) NOT NULL,
  `sem` int(4) NOT NULL,
  `amount` int(11) NOT NULL,
  `unpaid` int(11) NOT NULL,
  `description` varchar(30) NOT NULL,
  `Time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=601 DEFAULT CHARSET=utf8;


